// App.js
import React from 'react';
import logo from './logo_image.jpg';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Navbar from './Component/Navbar';
// import Home from './Component/Pages/Home';
import Products from './Component/Pages/Products';
import CreateAccount from './Component/Pages/CreateAccount';
import Order from './Component/Pages/Order';
import Cart from './Component/Pages/Cart'; // Import Cart component
import AdminDashboard from './Component/Pages/adminDashboard'; // Import AdminDashboard component

import './App.css';
import Footer from './Component/Footer';

function App() {
  const handleSearch = () => {
    console.log('Perform search');
  };

  return (
    <div className="App">
      <header className="App-header">
        <div className="left-section">
          <img src={logo} className="App-logo" alt="logo" />
        </div>

        <div className="search-bar">
          <input className="active" type="text" placeholder="Search..." />
          <button onClick={handleSearch}>Search</button>
        </div>
      </header>

      <Router>
        <div> 
          <Navbar />
          <Switch>

            <Route path="/product">
              <Products />
            </Route>
            <Route path="/cart">
              <Cart />
            </Route>
            <Route path="/create-account">
              <CreateAccount />
            </Route>
            <Route path="/order">
              <Order />
            </Route>
            <Route path="/admin-dashboard">
              <AdminDashboard />
            </Route>
            {/* Example Route for Login */}
            {/* <Route path="/login">
              <Login /> {/* Correct usage of Login component */}
            {/* </Route> */}
          </Switch>
          <Footer />
        </div>
      </Router>
    </div>
  );
}

export default App;
